import React from "react";

const Bold_content = props => (
  <span style={{ fontWeight: "bold" }}>{props.content}</span>
);

const about = props => (
  <div>
    <p style={{ fontSize: "1.5rem" }}>
      I am a <Bold_content content="bachelor's student" /> at the
      <Bold_content content=" School of Electrical and Computer Engineering" />
      at
      <Bold_content content="College of Engineering, University of Tehran, Iran" />
      . My primary research interests are
      <Bold_content content=" Machine Learning" /> (esp. Deep Learning) and
      Artificial Intelligence . In particular, I'm fascinated by the new Deep
      Generative Models and new applications of Deep Learning in Computer
      Vision, Genomics and more.
    </p>
    <h1 />
  </div>
);

export default about;
